import { useNavigate } from 'react-router-dom'; // Importando useNavigate

function Preco() {
  const navigate = useNavigate(); // Usando o React Router para navegação

  // Função que navega até o componente Lamula
  const goToLamula = () => {
    navigate('/lamula'); // Roteia para a página Lamula
  };

  return (
    <div className='flex items-center justify-center'>
      <div className="carousel w-full max-w-md shadow">
        <div id="slide1" className="carousel-item relative w-full">
          <div className="card bg-base-100 h-96 w-96">
            <div className="card-body">
              <h2 className="card-title">Shoes!</h2>
              <p>If a dog chews shoes whose shoes does he choose?</p>
              <div className="card-actions justify-end">
                <button className="btn btn-primary" onClick={goToLamula}>Buy Now</button>
              </div>
            </div>
          </div>
          <div className="absolute left-5 right-5 top-1/2 flex -translate-y-1/2 transform justify-between">
            <a href="#slide4" className="btn btn-circle">❮</a>
            <a href="#slide2" className="btn btn-circle">❯</a>
          </div>
        </div>
        {/* Resto dos slides */}
      </div>
    </div>
  );
}

export default Preco;
